import java.util.Comparator;
import java.util.PriorityQueue;

public class Solution {
    public int solveOrderMatching(int[][] orders) {
        PriorityQueue<Integer> buyOrders = new PriorityQueue<>(Comparator.reverseOrder());
        PriorityQueue<Integer> sellOrders = new PriorityQueue<>();
        long backlog = 0;
        int MOD = 1000000007;

        for (int[] order : orders) {
            int price = order[0];
            int amount = order[1];
            int orderType = order[2];

            if (orderType == 0) { // Buy order
                if (!sellOrders.isEmpty() && sellOrders.peek() <= price) {
                    int executeAmount = Math.min(amount, sellOrders.peek());
                    amount -= executeAmount;
                    sellOrders.poll();
                }
                if (amount > 0) {
                    buyOrders.offer(price);
                }
            } else { // Sell order
                if (!buyOrders.isEmpty() && buyOrders.peek() >= price) {
                    int executeAmount = Math.min(amount, buyOrders.peek());
                    amount -= executeAmount;
                    buyOrders.poll();
                }
                if (amount > 0) {
                    sellOrders.offer(price);
                }
            }
        }

        backlog = buyOrders.size() + sellOrders.size();
        return (int) (backlog % MOD);
    }
}

