public class Solution {
    public int maxSumMinProduct(int[] nums) {
        int n = nums.length;
        long MOD = 1000000007;

        long[] prefixSum = new long[n + 1];
        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = (prefixSum[i] + nums[i]) % MOD;
        }

        long maxMinProduct = 0;

        for (int i = 0; i < n; i++) {
            for (int j = i; j < n; j++) {
                long currentSum = prefixSum[j + 1] - prefixSum[i];
                int minVal = nums[i];
                for (int k = i; k <= j; k++) {
                    minVal = Math.min(minVal, nums[k]);
                }
                maxMinProduct = Math.max(maxMinProduct, (long) minVal * currentSum);
            }
        }

        return (int) (maxMinProduct % MOD);
    }
}

