public class Solution {
    public int makeStringSorted(String s) {
        int n = s.length();
        long operations = 0;
        int mod = 1000000007;

        while (true) {
            boolean sorted = true;
            for (int i = 0; i < n - 1; i++) {
                if (s.charAt(i) > s.charAt(i + 1)) {
                    sorted = false;
                    break;
                }
            }
            if (sorted) {
                break;
            }

            int i = -1;
            for (int k = n - 1; k >= 0; k--) {
                if (k > 0 && s.charAt(k) < s.charAt(k - 1)) {
                    i = k;
                    break;
                }
            }

            int j = -1;
            for (int k = i; k < n; k++) {
                boolean valid = true;
                for (int l = i; l <= k; l++) {
                    if (s.charAt(l) < s.charAt(i - 1)) {
                        valid = false;
                        break;
                    }
                }
                if (valid) {
                    j = k;
                }
            }

            if (i != -1 && j != -1) {
                char temp = s.charAt(i - 1);
                s = s.substring(0, i - 1) + s.charAt(j) + s.substring(i - 1, j + 1) + temp + s.substring(j + 1);
                operations = (operations + 1) % mod;
            } else {
                break;
            }
        }

        return (int) operations;
    }
}

