import java.util.Arrays;

public class Solution {
    public int rearrangeSticks(int n, int k) {
        long MOD = 1000000007;
        if (k > n) {
            return 0;
        }
        if (k == 0) {
            return 1;
        }

        long[] dp = new long[n + 1];
        dp[0] = 1;

        for (int i = 1; i <= n; i++) {
            dp[i] = dp[i - 1] * i;
            if (i > k) {
                dp[i] = (dp[i] * (i - k)) % MOD;
            }
        }

        long result = 1;
        for (int i = 1; i <= k; i++) {
            result = (result * i) % MOD;
        }

        return (int) ((dp[n] * result) % MOD);
    }
}

