public class Solution {
    public int minSwaps(String s) {
        int n = s.length();
        int zeros = 0;
        int ones = 0;
        for (char c : s.toCharArray()) {
            if (c == '0') {
                zeros++;
            } else {
                ones++;
            }
        }

        if (Math.abs(zeros - ones) > 1) {
            return -1;
        }

        int swaps = 0;
        int expected = (zeros > ones) ? 1 : 0;
        for (int i = 0; i < n; i++) {
            if (s.charAt(i) != (char)('0' + expected)) {
                swaps++;
            }
            expected = 1 - expected;
        }

        return swaps / 2;
    }
}

