public class Solution {
    public int countNicePairs(int[] nums) {
        long count = 0;
        long MOD = 1000000007;
        HashMap<Integer, Integer> diffCount = new HashMap<>();

        for (int num : nums) {
            int rev = reverse(num);
            int diff = num - rev;

            if (diffCount.containsKey(diff)) {
                count = (count + diffCount.get(diff)) % MOD;
                diffCount.put(diff, diffCount.get(diff) + 1);
            } else {
                diffCount.put(diff, 1);
            }
        }

        return (int) count;
    }

    private int reverse(int x) {
        int rev = 0;
        while (x > 0) {
            rev = rev * 10 + x % 10;
            x /= 10;
        }
        return rev;
    }
}

