public class Solution {
    public int maxFrequency(int[] nums, int k) {
        Arrays.sort(nums);
        long sum = 0;
        int maxFreq = 0;
        int left = 0;
        for (int right = 0; right < nums.length; right++) {
            sum += (long) nums[right];
            while ((long) nums[right] * (right - left + 1) - sum > k) {
                sum -= (long) nums[left];
                left++;
            }
            maxFreq = Math.max(maxFreq, right - left + 1);
        }
        return maxFreq;
    }
