public class Solution {
    public int chalkReplacer(int[] chalk, int k) {
        int n = chalk.length;
        long[] prefixSum = new long[n + 1];
        long totalChalk = 0;
        for (int i = 0; i < n; i++) {
            totalChalk += chalk[i];
            prefixSum[i + 1] = totalChalk;
        }

        int left = 0;
        int right = n - 1;
        int result = -1;

        while (left <= right) {
            int mid = left + (right - left) / 2;
            long sum = 0;
            for (int i = 0; i < n; i++) {
                sum += Math.min((long)k, (long)chalk[i]);
            }

            if (prefixSum[mid + 1] >= k) {
                result = mid;
                right = mid - 1;
            } else {
                left = mid + 1;
            }
        }

        if (result == -1) {
            return 0;
        }

        int studentIndex = 0;
        long currentChalk = k;
        for (int i = 0; i <= result; i++) {
            if (currentChalk < chalk[i]) {
                studentIndex = i;
                break;
            }
            currentChalk -= chalk[i];
        }

        return studentIndex;
