import java.util.Arrays;
import java.util.Comparator;
import java.util.PriorityQueue;

public class Solution {
    public int[] minInterval(int[][] intervals, int[] queries) {
        int n = intervals.length;
        int m = queries.length;
        int[] ans = new int[m];
        Arrays.fill(ans, -1);

        // Sort intervals based on their start times
        Arrays.sort(intervals, Comparator.comparingInt(a -> a[0]));

        // Create a priority queue to store intervals sorted by their size
        PriorityQueue<int[]> pq = new PriorityQueue<>(Comparator.comparingInt(a -> a[1] - a[0] + 1));

        int intervalIndex = 0;
        for (int i = 0; i < m; i++) {
            // Add intervals that start before or at the query value to the priority queue
            while (intervalIndex < n && intervals[intervalIndex][0] <= queries[i]) {
                pq.offer(intervals[intervalIndex]);
                intervalIndex++;
            }

            // Remove intervals from the priority queue that end before the query value
            while (!pq.isEmpty() && pq.peek()[1] < queries[i]) {
                pq.poll();
            }

            // If the priority queue is not empty, the answer is the size of the smallest interval
            if (!pq.isEmpty()) {
                ans[i] = pq.peek()[1] - pq.peek()[0] + 1;
            }
        }

        return ans;
    }
}

