public class Solution {
    public int twoEggDrop(int n) {
        int[][] dp = new int[n + 1][n + 1];

        for (int i = 1; i <= n; i++) {
            dp[i][1] = i;
        }

        for (int j = 2; j <= n; j++) {
            for (int i = 1; i <= n; i++) {
                dp[i][j] = Integer.MAX_VALUE;
                for (int x = 1; x <= i; x++) {
                    int breakResult = dp[x - 1][j - 1];
                    int noBreakResult = dp[i - x][j - 1];
                    int result = 1 + Math.max(breakResult, noBreakResult);
                    dp[i][j] = Math.min(dp[i][j], result);
                }
            }
        }

        return dp[n][n];
    }
}

