import java.util.Arrays;

public class Solution {
    public int minimumXORSum(int[] nums1, int[] nums2) {
        int n = nums1.length;
        int[][] dp = new int[1 << n][n + 1];

        for (int mask = 0; mask < (1 << n); mask++) {
            Arrays.fill(dp[mask], Integer.MAX_VALUE);
        }

        dp[0][0] = 0;

        for (int mask = 0; mask < (1 << n); mask++) {
            for (int j = 0; j < n; j++) {
                if (dp[mask][j] != Integer.MAX_VALUE) {
                    int nextMask = mask | (1 << j);
                    for (int k = 0; k < n; k++) {
                        if ((nextMask & (1 << k)) == 0) {
                            dp[nextMask][k] = Math.min(dp[nextMask][k], dp[mask][j] + (nums1[j] ^ nums2[k]));
                        }
                    }
                }
            }
        }

        int minXorSum = Integer.MAX_VALUE;
        for (int k = 0; k < n; k++) {
            minXorSum = Math.min(minXorSum, dp[(1 << n) - 1][k]);
        }

        return minXorSum;
    }
}

