import java.util.Arrays;
import java.util.Comparator;
import java.util.PriorityQueue;

public class Solution {
    public int[] getOrder(int[][] tasks) {
        int n = tasks.length;
        int[] order = new int[n];
        int[] finishTime = new int[n];

        for (int i = 0; i < n; i++) {
            finishTime[i] = tasks[i][0] + tasks[i][1];
        }

        Integer[] indices = new Integer[n];
        for (int i = 0; i < n; i++) {
            indices[i] = i;
        }

        Arrays.sort(indices, Comparator.comparingInt(i -> finishTime[i]));

        PriorityQueue<int[]> pq = new PriorityQueue<>(Comparator.comparingInt((int[] task) -> task[1]).thenComparing(task -> task[0]));
        int currentTime = 0;
        int taskIndex = 0;
        int completedTasks = 0;
        int[] result = new int[n];
        int resultIndex = 0;

        while (completedTasks < n) {
            while (taskIndex < n && tasks[indices[taskIndex]][0] <= currentTime) {
                pq.offer(new int[]{indices[taskIndex], tasks[indices[taskIndex]][1]});
                taskIndex++;
            }

            if (pq.isEmpty()) {
                if (taskIndex < n) {
                    currentTime = tasks[indices[taskIndex]][0];
                } else {
                    break;
                }
            } else {
                int[] currentTask = pq.poll();
                int index = currentTask[0];
                int processingTime = currentTask[1];
                result[resultIndex++] = index;
                currentTime += processingTime;
                completedTasks++;
            }
        }

        return result;
    }
}

