public class Solution {
    public int minSkips(int[] dist, int speed, int hoursBefore) {
        int n = dist.length;
        double[][] dp = new double[n + 1][n + 1];
        for (int i = 0; i <= n; i++) {
            Arrays.fill(dp[i], Double.MAX_VALUE);
        }
        dp[0][0] = 0;

        for (int i = 1; i <= n; i++) {
            for (int j = 0; j <= i; j++) {
                double time = dist[i - 1] / speed;
                if (dp[i - 1][j] != Double.MAX_VALUE) {
                    dp[i][j] = Math.min(dp[i][j], dp[i - 1][j] + time);
                    if (j > 0) {
                        dp[i][j - 1] = Math.min(dp[i][j - 1], dp[i - 1][j] + time);
                    }
                }
            }
        }

        double minSkips = Double.MAX_VALUE;
        for (int j = 0; j <= n; j++) {
            if (dp[n][j] <= hoursBefore) {
                minSkips = Math.min(minSkips, j);
            }
        }

        if (minSkips == Double.MAX_VALUE) {
            return -1;
        }

        return (int) minSkips;
    }
}

