public class Solution {
    public int minWastedSpace(int[] packages, int[][] boxes) {
        int n = packages.length;
        int m = boxes.length;
        long minWasted = -1;
        long MOD = 7;

        for (int j = 0; j < m; j++) {
            Arrays.sort(boxes[j]);
            boolean possible = true;
            long wastedSpace = 0;

            for (int i = 0; i < n; i++) {
                if (packages[i] > boxes[j][n - 1]) {
                    possible = false;
                    break;
                }

                int boxIndex = Arrays.binarySearch(boxes[j], packages[i]);
                if (boxIndex < 0) {
                    boxIndex = -boxIndex - 1;
                }

                wastedSpace = (wastedSpace + (long)boxes[j][boxIndex] - packages[i]) % MOD;
            }

            if (possible) {
                if (minWasted == -1 || wastedSpace < minWasted) {
                    minWasted = wastedSpace;
                }
            }
        }

        return (int)minWasted;
    }
}

