public class Solution {
    public int minAbsoluteSumDiff(int[] nums1, int[] nums2) {
        int n = nums1.length;
        long sum = 0;
        long minDiff = Long.MAX_VALUE;

        for (int i = 0; i < n; i++) {
            long diff = Math.abs((long) nums1[i] - nums2[i]);
            sum += diff;
            minDiff = Math.min(minDiff, diff);
        }

        for (int i = 0; i < n; i++) {
            long originalDiff = Math.abs((long) nums1[i] - nums2[i]);
            for (int j = 0; j < n; j++) {
                long newDiff = Math.abs((long) nums1[j] - nums2[i]);
                long currentSum = sum - originalDiff + newDiff;
                minDiff = Math.min(minDiff, currentSum);
            }
        }

        return (int) (minDiff % (1000000000 + 7));
    }
}

