public class Solution {
    public int subsetXORSum(int[] nums) {
        int n = nums.length;
        int totalXORSum = 0;

        for (int i = 0; i < (1 << n); i++) {
            int currentXOR = 0;
            for (int j = 0; j < n; j++) {
                if ((i >> j) % 2 == 1) {
                    currentXOR ^= nums[j];
                }
            }
            totalXORSum += currentXOR;
        }

        return totalXORSum;
    }
}

