import java.util.*;

public class Solution {
    public boolean canReach(String s, int minJump, int maxJump) {
        if (s.length() == 0) {
            return true;
        }

        Queue<Integer> q = new LinkedList<>();
        q.offer(0);
        Set<Integer> visited = new HashSet<>();
        visited.add(0);

        while (!q.isEmpty()) {
            int curr = q.poll();

            if (curr == s.length() - 1) {
                return true;
            }

            for (int j = curr + minJump; j <= Math.min(curr + maxJump, s.length() - 1); j++) {
                if (s.charAt(j) == '0' && !visited.contains(j)) {
                    q.offer(j);
                    visited.add(j);
                }
            }
        }

        return false;
    }
}

