public class Solution {
    public int largestMagicSquare(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;
        int largest = 0;

        for (int k = Math.min(m, n); k >= 1; k--) {
            for (int i = 0; i <= m - k; i++) {
                for (int j = 0; j <= n - k; j++) {
                    if (isMagicSquare(grid, i, j, k)) {
                        return k;
                    }
                }
            }
        }

        return 0;
    }

    private boolean isMagicSquare(int[][] grid, int rowStart, int colStart, int k) {
        int magicSum = 0;
        for (int j = colStart; j < colStart + k; j++) {
            magicSum += grid[rowStart][j];
        }

        // Check rows
        for (int i = rowStart; i < rowStart + k; i++) {
            int rowSum = 0;
            for (int j = colStart; j < colStart + k; j++) {
                rowSum += grid[i][j];
            }
            if (rowSum != magicSum) {
                return false;
            }
        }

        // Check columns
        for (int j = colStart; j < colStart + k; j++) {
            int colSum = 0;
            for (int i = rowStart; i < rowStart + k; i++) {
                colSum += grid[i][j];
            }
            if (colSum != magicSum) {
                return false;
            }
        }

        // Check main diagonal
        int mainDiagonalSum = 0;
        for (int i = 0; i < k; i++) {
            mainDiagonalSum += grid[rowStart + i][colStart + i];
        }
        if (mainDiagonalSum != magicSum) {
            return false;
        }

        // Check anti-diagonal
        int antiDiagonalSum = 0;
        for (int i = 0; i < k; i++) {
            antiDiagonalSum += grid[rowStart + i][colStart + k - 1 - i];
        }
        if (antiDiagonalSum != magicSum) {
            return false;
        }

        return true;
    }
}

