import java.util.HashSet;
import java.util.Set;

public class Solution {
    public int numDifferentIntegers(String word) {
        StringBuilder sb = new StringBuilder();
        for (char c : word.toCharArray()) {
            if (Character.isDigit(c)) {
                sb.append(c);
            } else {
                sb.append(' ');
            }
        }

        String[] nums = sb.toString().split("\\s+");
        Set<String> distinctIntegers = new HashSet<>();

        for (String num : nums) {
            if (!num.isEmpty()) {
                String cleanedNum = cleanLeadingZeros(num);
                distinctIntegers.add(cleanedNum);
            }
        }

        return distinctIntegers.size();
    }

    private String cleanLeadingZeros(String s) {
        int i = 0;
        while (i < s.length() - 1 && s.charAt(i) == '0') {
            i++;
        }
        return s.substring(i);
    }
}

