import java.util.ArrayList;
import java.util.List;

public class Solution {

    private static final int MOD = 1000000007;

    public int maxNiceDivisors(int primeFactors) {
        if (primeFactors == 1) {
            return 1;
        }
        if (primeFactors == 2) {
            return 2;
        }
        if (primeFactors == 3) {
            return 4;
        }
        if (primeFactors == 4) {
            return 8;
        }
        if (primeFactors == 5) {
            return 16;
        }

        long result = 1;
        int numFactors = 0;

        if (primeFactors % 2 == 0) {
            result = power(2, primeFactors / 2 - 1);
            result = (result * 2) % MOD;
        } else {
            result = power(2, (primeFactors - 1) / 2);
            result = (result * (primeFactors - 1)) % MOD;
        }

        return (int) result;
    }

    private long power(long base, int exp) {
        long res = 1;
        base %= MOD;
        while (exp > 0) {
            if (exp % 2 == 1) res = (res * base) % MOD;
            base = (base * base) % MOD;
            exp /= 2;
        }
        return res;
    }
}

