        int taskIndex = 0;
        while (taskIndex < m || !waitQueue.isEmpty() || !availableServers.isEmpty()) {
            if (availableServers.isEmpty() && waitQueue.isEmpty()) {
                time++;
                continue;
            }
            while (taskIndex < m && time < tasks[taskIndex] + time) {
                waitQueue.offer(new int[]{taskIndex, tasks[taskIndex]});
                taskIndex++;
            }
            if (waitQueue.isEmpty()) {
                time++;
                continue;
            }
            if (availableServers.isEmpty()) {
                time = waitQueue.peek()[1] + time;
                time = Math.max(time, waitQueue.peek()[1]);
            }
            int[] task = waitQueue.poll();
            int serverIndex = availableServers.poll();
            ans[task[0]] = serverIndex;
            time += tasks[task[0]];
            availableServers.offer(serverIndex);
        }
        return ans;
    }
}

