public class Solution {
    public int maximumRemovals(String s, String p, int[] removable) {
        int left = 0;
        int right = removable.length;
        int ans = 0;

        while (left <= right) {
            int mid = left + (right - left) / 2;
            String tempS = removeChars(s, removable, mid);
            if (isSubsequence(p, tempS)) {
                ans = mid;
                left = mid + 1;
            } else {
