        }
        return sb.toString();
    }

    private boolean isSubsequence(String p, String s) {
        int i = 0;
        int j = 0;
        while (i < p.length() && j < s.length()) {
            if (p.charAt(i) == s.charAt(j)) {
                i++;
            }
            j++;
        }
        return i == p.length();
    }
}

