public class Solution {
    public int largestPathValue(String colors, int[][] edges) {
        int n = colors.length();
        List<ArrayList<Integer>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            adj.get(edge[0]).add(edge[1]);
        }

        int[] inDegree = new int[n];
        for (int[] edge : edges) {
            inDegree[edge[1]]++;
        }

        ArrayList<Integer> queue = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            if (inDegree[i] == 0) {
                queue.add(i);
            }
        }

        int[] count = new int[26];
        int[][] dp = new int[n][26];
        for (int i = 0; i < n; i++) {
            Arrays.fill(dp[i], -1);
        }

        int maxVal = 0;
        int visitedNodes = 0;

        while (!queue.isEmpty()) {
            int node = queue.remove(0);
            visitedNodes++;

            for (int i = 0; i < 26; i++) {
                if (node < colors.length() && (int) (colors.charAt(node) - 'a') == i) {
                    dp[node][i] = 1;
                }
            }

            for (int neighbor : adj.get(node)) {
                for (int i = 0; i < 26; i++) {
                    if (dp[node][i] != -1) {
                        dp[neighbor][i] = Math.max(dp[neighbor][i], dp[node][i] + 1);
                    }
                }
                inDegree[neighbor]--;
                if (inDegree[neighbor] == 0) {
                    queue.add(neighbor);
                }
            }
        }

        if (visitedNodes != n) {
            return -1;
        }

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < 26; j++) {
                maxVal = Math.max(maxVal, dp[i][j]);
            }
        }

        return maxVal;
    }
}

