public class Solution {
    public int shortestPathAllKeys(String[] grid) {
        int m = grid.length;
        int n = grid[0].length();
        int allKeys = 0;
        int startRow = -1;
        int startCol = -1;

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                char c = grid[i].charAt(j);
                if (c >= 'a' && c <= 'z') {
                    allKeys |= (1 << (c - 'a'));
                } else if (c == '@') {
                    startRow = i;
                    startCol = j;
                }
            }
        }

        int[][] directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[]{startRow, startCol, 0, 0}); // row, col, keys, moves
        boolean[][][] visited = new boolean[m][n][1 << 6];
        visited[startRow][startCol][0] = true;

        while (!queue.isEmpty()) {
            int[] current = queue.poll();
            int row = current[0];
            int col = current[1];
            int keys = current[2];
            int moves = current[3];

            if (keys == allKeys) {
                return moves;
            }

            for (int[] dir : directions) {
                int newRow = row + dir[0];
                int newCol = col + dir[1];

                if (newRow >= 0 && newRow < m && newCol >= 0 && newCol < n && grid[newRow].charAt(newCol) != '#') {
                    char c = grid[newRow].charAt(newCol);

                    if (c >= 'a' && c <= 'z') {
                        int newKeys = keys | (1 << (c - 'a'));
                        if (!visited[newRow][newCol][newKeys]) {
                            visited[newRow][newCol][newKeys] = true;
                            queue.offer(new int[]{newRow, newCol, newKeys, moves + 1});
                        }
                    } else if (c >= 'A' && c <= 'Z') {
                        int keyIndex = c - 'A';
                        if ((keys & (1 << keyIndex)) != 0) {
                            if (!visited[newRow][newCol][keys]) {
                                visited[newRow][newCol][keys] = true;
                                queue.offer(new int[]{newRow, newCol, keys, moves + 1});
                            }
                        }
                    } else {
                        if (!visited[newRow][newCol][keys]) {
                            visited[newRow][newCol][keys] = true;
                            queue.offer(new int[]{newRow, newCol, keys, moves + 1});
                        }
                    }
                }
            }
        }

        return -1;
    }
}

