import java.util.ArrayList;
import java.util.List;

public class Solution {
    public List<Integer> splitIntoFibonacci(String num) {
        List<Integer> result = new ArrayList<>();
        backtrack(num, 0, result);
        return result;
    }

    private boolean backtrack(String num, int index, List<Integer> result) {
        if (index == num.length() && result.size() >= 3) {
            return true;
        }

        for (int i = index; i < num.length(); i++) {
            String sub = num.substring(index, i + 1);
            if (sub.length() > 1 && sub.startsWith("0")) {
                continue;
            }

            try {
                long n = Long.parseLong(sub);
                if (n > Integer.MAX_VALUE) {
                    continue;
                }
                int numInt = (int) n;

                if (result.size() < 2) {
                    result.add(numInt);
                    if (backtrack(num, i + 1, result)) {
                        return true;
                    }
                    result.remove(result.size() - 1);
                } else {
                    int sum = result.get(result.size() - 1) + result.get(result.size() - 2);
                    if (sum == numInt) {
                        result.add(numInt);
                        if (backtrack(num, i + 1, result)) {
                            return true;
                        }
                        result.remove(result.size() - 1);
                    } else if (sum < numInt) {
                        continue;
                    } else {
                        break;
                    }
                }
            } catch (NumberFormatException e) {
                break;
            }
        }

        return false;
    }
}

