public class Solution {
    public int superEggDrop(int k, int n) {
        if (n == 0) {
            return 0;
        }
        if (k == 1) {
            return n;
        }

        int[][] dp = new int[k + 1][n + 1];

        for (int i = 1; i <= k; i++) {
            dp[i][1] = 1;
            dp[i][i] = i;
        }

        for (int j = 2; j <= n; j++) {
            for (int i = 1; i <= k; i++) {
                dp[i][j] = Integer.MAX_VALUE;
                for (int x = 1; x <= j; x++) {
                    int break_case = dp[i - 1][x - 1];
                    int no_break_case = dp[i][x + 1];
                    int temp = 1 + Math.max(break_case, no_break_case);
                    dp[i][j] = Math.min(dp[i][j], temp);
                }
            }
        }

        return dp[k][n];
    }
}

