public class Solution {
    public int racecar(int target) {
        Queue<int[]> q = new LinkedList<>();
        q.offer(new int[]{0, 1, 0}); // position, speed, steps
        boolean[][] visited = new boolean[2 * target + 1][2];

        while (!q.isEmpty()) {
            int[] curr = q.poll();
            int pos = curr[0];
            int speed = curr[1];
            int steps = curr[2];

            if (pos == target) {
                return steps;
            }

            if (Math.abs(pos - target) > target && steps > 10000) {
                continue;
