                continue;
            }
            visited[pos + target][speed > 0 ? 1 : 0] = true;

            // Accelerate
            int newPosA = pos + speed;
            int newSpeedA = speed > 0 ? 2 : -2;
            if (Math.abs(newPosA - target) < target * 2) {
                q.offer(new int[]{newPosA, newSpeedA, steps + 1});
            }

            // Reverse
            int newSpeedR = speed > 0 ? -1 : 1;
            q.offer(new int[]{pos, newSpeedR, steps + 1});
        }

        return -1;
