                    // Check if back[j] is good
                    boolean isGood = true;
                    for (int k = 0; k < n; k++) {
                        if (k != j && (i >> k) % 2 == 0 && fronts[k] == backs[j]) {
                            isGood = false;
                            break;
                        }
                    }
                    if (isGood) {
                        foundGood = true;
                        smallestGood = Math.min(smallestGood, backs[j]);
                    }
                } else {
                    // Check if front[j] is good
                    boolean isGood = true;
                    for (int k = 0; k < n; k++) {
                        if (k != j && (i >> k) % 2 == 1 && backs[k] == fronts[j]) {
                            isGood = false;
                            break;
                        }
                    }
                    if (isGood) {
                        foundGood = true;
                        smallestGood = Math.min(smallestGood, fronts[j]);
                    }
                }
            }

            if (!foundGood) {
                continue;
            }
        }

        if (smallestGood == Integer.MAX_VALUE) {
            return -1;
        }

        return smallestGood;
    }
}

