import com_github_leetcode.TreeNode;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public TreeNode constructFromPrePost(int[] preorder, int[] postorder) {
        if (preorder == null || postorder == null || preorder.length == 0 || postorder.length == 0) {
            return null;
        }

        Map<Integer, Integer> indexMap = new HashMap<>();
        for (int i = 0; i < preorder.length; i++) {
            indexMap.put(preorder[i], i);
        }

        return constructHelper(preorder, postorder, 0, preorder.length - 1, 0, postorder.length - 1, indexMap);
    }

    private TreeNode constructHelper(int[] preorder, int[] postorder, int preStart, int preEnd, int postStart, int postEnd, Map<Integer, Integer> indexMap) {
        if (preStart > preEnd) {
            return null;
        }

        int rootVal = preorder[preStart];
        TreeNode root = new TreeNode(rootVal);

        if (preStart == preEnd) {
            return root;
        }

        int leftRootIndex = indexMap.get(rootVal);
        int leftTreeSize = leftRootIndex - preStart;

        root.left = constructHelper(preorder, postorder, preStart + 1, preStart + leftTreeSize, postStart, postStart + leftTreeSize - 1, indexMap);
        root.right = constructHelper(preorder, postorder, preStart + leftTreeSize + 1, preEnd, postStart + leftTreeSize, postEnd - 1, indexMap);

        return root;
    }
}

