import java.util.ArrayDeque;
import java.util.ArrayList;
import java.util.Arrays;
import java.util.HashSet;
import java.util.List;
import java.util.Queue;
import java.util.Set;

public class Solution {
    public int numBusesToDestination(int[][] routes, int source, int target) {
        if (source == target) {
            return 0;
        }

        Set<Integer> sourceStops = new HashSet<>();
        sourceStops.add(source);

        Set<Integer> targetStops = new HashSet<>();
        targetStops.add(target);

        List<List<Integer>> adj = new ArrayList<>();
        for (int[] route : routes) {
            List<Integer> busStops = new ArrayList<>();
            for (int stop : route) {
                busStops.add(stop);
            }
            adj.add(busStops);
        }

        Set<Integer> visitedBuses = new HashSet<>();
        Queue<Integer> queue = new ArrayDeque<>();
        queue.offer(0);
        visitedBuses.add(0);
        int busesTaken = 1;

        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                int busRouteIndex = queue.poll();
                List<Integer> stops = adj.get(busRouteIndex);

                for (int stop : stops) {
                    if (targetStops.contains(stop)) {
                        return busesTaken;
                    }

                    if (!sourceStops.contains(stop)) {
                        sourceStops.add(stop);
                    }
                }

                for (int nextBusRouteIndex = 0; nextBusRouteIndex < routes.length; nextBusRouteIndex++) {
                    if (!visitedBuses.contains(nextBusRouteIndex)) {
                        if (hasCommonStop(adj.get(busRouteIndex), adj.get(nextBusRouteIndex))) {
                            queue.offer(nextBusRouteIndex);
                            visitedBuses.add(nextBusRouteIndex);
                        }
                    }
                }
            }
            busesTaken++;
        }

        return -1;
    }

    private boolean hasCommonStop(List<Integer> route1, List<Integer> route2) {
        for (int stop1 : route1) {
            if (route2.contains(stop1)) {
                return true;
            }
        }
        return false;
    }
}

