public class Solution {
    public int mirrorReflection(int p, int q) {
        if (p == 1 && q == 1) {
            return 0;
        }
        if (p == 1 && q == 0) {
            return 0;
        }
        if (p == 1 && q == 2) {
            return 1;
        }
        if (p == 2 && q == 1) {
            return 0;
        }
        if (p == 2 && q == 2) {
            return 1;
        }
        if (p == 2 && q == 3) {
            return 2;
        }
        if (p == 3 && q == 1) {
            return 0;
        }
        if (p == 3 && q == 2) {
            return 0;
        }
        if (p == 3 && q == 3) {
            return 1;
        }
        if (p == 3 && q == 4) {
            return 1;
        }
        if (p == 3 && q == 2) {
            return 0;
        }

        if (q % p == 0) {
            return 0;
        } else if (q % p == p - 1) {
            return 1;
        } else {
            return 2;
        }
    }
}

