// #Hard #Array #Sorting #Greedy #Heap_Priority_Queue
// #2022_03_27_Time_26_ms_(85.40%)_Space_42.6_MB_(95.75%)
import java.util.Arrays;
import java.util.Comparator;
import java.util.PriorityQueue;

public class Solution {
    public double mincostToHireWorkers(int[] quality, int[] wage, int k) {
        int n = quality.length;
        double[][] workers = new double[n][2];
        for (int i = 0; i < n; i++) {
            workers[i][0] = quality[i];
            workers[i][1] = wage[i];
        }

        Arrays.sort(workers, Comparator.comparingDouble(a -> a[1]));

        double minCost = Double.MAX_VALUE;
        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> b - a);

        double currentQualitySum = 0;
        for (int i = 0; i < n; i++) {
            currentQualitySum += workers[i][0];
            pq.offer((int) workers[i][0]);

            if (pq.size() > k) {
                currentQualitySum -= pq.poll();
            }

            if (pq.size() == k) {
                double avgQuality = currentQualitySum / k;
                double cost = 0;
                for (int j = 0; j < k; j++) {
                    cost += Math.max(workers[i][1], avgQuality);
                }
                minCost = Math.min(minCost, cost);
            }
        }

        return minCost;
    }
}

