// #Hard #Dynamic_Programming #Breadth_First_Search #Bit_Manipulation #Graph #Bitmask
// #Graph_Theory_I_Day_10_Standard_Traversal #2022_03_24_Time_14_ms_(78.72%)_Space_45.2_MB_(71.96%)
import java.util.ArrayDeque;
import java.util.Objects;
import java.util.Queue;

public class Solution {
    public int shortestPathLength(int[][] graph) {
        int n = graph.length;
        if (n == 1) {
            return 0;
        }

        int allVisited = (1 << n) - 1;
        Queue<int[]> queue = new ArrayDeque<>();
        int[][] visited = new int[n][1 << n];

        for (int i = 0; i < n; i++) {
            queue.offer(new int[]{i, 1 << i});
            visited[i][1 << i] = 0;
        }

        while (!queue.isEmpty()) {
            int[] curr = queue.poll();
            int node = curr[0];
            int mask = curr[1];

            if (mask == allVisited) {
                return visited[node][mask];
            }

            for (int neighbor : graph[node]) {
                int newMask = mask | (1 << neighbor);
                if (visited[neighbor][newMask] == 0) {
                    visited[neighbor][newMask] = visited[node][mask] + 1;
                    queue.offer(new int[]{neighbor, newMask});
                }
            }
        }

        return -1;
    }
}

