import java.util.Arrays;

public class Solution {
    public int sumSubseqWidths(int[] nums) {
        Arrays.sort(nums);
        int n = nums.length;
        long sum = 0;
        long mod = 1000000007;

        for (int i = 0; i < n; i++) {
            long width = nums[i] - nums[0];
            long powerOfTwo = 1;
            for (int j = 0; j < i; j++) {
                powerOfTwo = (powerOfTwo * 2) % mod;
            }
            sum = (sum + (width * powerOfTwo) % mod) % mod;
        }

        for (int i = 0; i < n; i++) {
            long width = nums[n - 1] - nums[i];
            long powerOfTwo = 1;
            for (int j = 0; j < i; j++) {
                powerOfTwo = (powerOfTwo * 2) % mod;
            }
            sum = (sum - (width * powerOfTwo) % mod + mod) % mod;
        }

        return (int) sum;
    }
}

