import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int numFactoredBinaryTrees(int[] arr) {
        int MOD = 1000000007;
        int n = arr.length;
        long[] dp = new long[n];
        Arrays.fill(dp, 0);
        dp[0] = 1;

        for (int i = 1; i < n; i++) {
            for (int j = 0; j < i; j++) {
                if (arr[i] % arr[j] == 0) {
                    int k = arr[i] / arr[j];
                    boolean found = false;
                    for (int l = 0; l < n; l++) {
                        if (arr[l] == k) {
                            found = true;
                            break;
                        }
                    }
                    if (found) {
                        dp[i] = (dp[i] + dp[j] * dp[i - j - 1]) % MOD;
                    }
                }
            }
            if (dp[i] == 0) {
                dp[i] = 1;
            }
        }

        long result = 0;
        for (int i = 0; i < n; i++) {
            result = (result + dp[i]) % MOD;
        }

        return (int) result;
    }
}

